Sri Lanka is facing its worst humanitarian and economic crisis in decades, with an estimated 2.8 million children urgently in need of assistance. Food, medical supplies and fuel shortages, as well as electricity cuts, are heavily impacting communities around the country.

I recently sat down with two young cricketers to speak more about the crisis and the world for kids today. As you can tell, children in Sri Lanka are at the heart of the what’s happening, with the escalating situation depriving them of their rights and leaving a lasting impact on their well-being and development.

You can support kids like Kowsala & Sathuja today by donating via the link in my bio.

